"ref":"opshin",
"url":0,
"doc":"    opshin                   > You are building what you want. Why not also build  how you want? This is an implementation of smart contracts for Cardano which are written in a strict subset of valid Python. The general philosophy of this project is to write a compiler that ensure the following: If the program compiles then: 1. it is a valid Python program 2. the output running it with python is the same as running it on-chain.  Why opshin? - 100% valid Python. Leverage the existing tool stack for Python, syntax highlighting, linting, debugging, unit-testing, [property-based testing](https: hypothesis.readthedocs.io/), [verification](https: github.com/marcoeilers/nagini) - Intuitive. Just like Python. - Flexible. Imperative, functional, the way you want it. - Efficient & Secure. Static type inference ensures strict typing and optimized code  Getting Started Check out the [OpShin Book](https: book.opshin.dev) for an introduction to this tool and details into writing smart contracts. This document will just outline the basic usage of the tool.  Installation Install Python 3.8, 3.9, 3.10 or 3.11. Then run   python3 -m pip install opshin    Writing a Smart Contract Check out the [OpShin Book](https: book.opshin.dev) for an introduction to this tool and details into writing smart contracts.  Compiling Write your program in python. You may start with the content of  examples . Arguments to scripts are passed in as Plutus Data objects in JSON notation. You can run any of the following commands    Evaluate script in Python - this can be used to make sure there are no obvious errors opshin eval spending examples/smart_contracts/assert_sum.py \"{\\\"int\\\": 4}\" \"{\\\"int\\\": 38}\"   Compile script to 'uplc', the Cardano Smart Contract assembly opshin compile spending examples/smart_contracts/assert_sum.py   Furthermore, you can add a shebang to the first line of the python file to indicate that it represents an opshin smart contract. You can choose from the following options: - a general shebang:  !opshin , which represents  opshin eval any - or a more specific purpose:  !/usr/bin/env -S opshin eval minting By doing so, you can transform your python file to an executable:  chmod +x your_file.py and execute it with  ./your_file.py , which will run  opshin eval any ./your_file.py under the hood.  Deploying The deploy process generates all artifacts required for usage with common libraries like [pycardano](https: github.com/Python-Cardano/pycardano), [lucid](https: github.com/spacebudz/lucid) and the [cardano-cli](https: github.com/input-output-hk/cardano-node).    Automatically generate all artifacts needed for using this contract opshin build spending examples/smart_contracts/assert_sum.py   See the [tutorial by  pycardano ](https: pycardano.readthedocs.io/en/latest/guides/plutus.html) for explanations how to build transactions with  opshin contracts.  API for Smart Contracts The python interface offers a simple API to compile, load, apply parameters and evaluate smart contracts.   from opshin.builder import   Build a validator script from a python file that contains a validator function contract = build(\"path/to/contract.py\")  You can apply parameters to the contract during compilation contract = build(\"path/to/contract.py\", arg1, arg2, arg3)  Store the compilation artifacts in a folder contract.dump(\"path/to/store\")  You can also load a compiled contract from a path contract = load(\"path/to/store\")  And apply parameters after loading a contract contract = contract.apply_parameters(arg1, arg2, arg3)  The artifacts contain the compiled script, the policy ID and the addresses and blueprint contract_addr = contract.mainnet_addr contract_blueprint = contract.blueprint    Debugging artefacts For debugging purposes, you can also run    Compile script to 'uplc', and evaluate the script in UPLC (for debugging purposes) opshin eval_uplc spending examples/smart_contracts/assert_sum.py \"{\\\"int\\\": 4}\" \"{\\\"int\\\": 38}\"   Compile script to 'pluto', an intermediate language (for debugging purposes) opshin compile_pluto spending examples/smart_contracts/assert_sum.py    Contributing  Developing and Technical Documentation Generally, all contributions on the code side are very welcome. To get an overview over the architecture and idea behind OpShin, check out [the Technical Documentation](./ARCHITECTURE.md). A bug bounty has been set up and funded by Project Catalyst, which awards [Github issue](https: github.com/OpShin/opshin/labels/bug%20bounty) resolution wiht ADA rewards. This is a great opportunity to get involved and earn some ADA. Check out the [detailed introduction to the bounty program](./BUG_BOUNTY.md) for more information.  Sponsoring You can sponsor the development of opshin through GitHub or [Patreon](https: patreon.com/OpShin) or just by sending ADA. Drop me a message on social media and let me know what it is for. -  Patreon Support OpShin at [Patreon](https: patreon.com/OpShin) to enjoy member benefits! -  GitHub Sponsor the developers of this project through the button \"Sponsor\" next to them -  ADA Donation in ADA can be submitted to  $opshin or  addr1qyz3vgd5xxevjy2rvqevz9n7n7dney8n6hqggp23479fm6vwpj9clsvsf85cd4xc59zjztr5zwpummwckmzr2myjwjns74lhmr .  Supporters             The main sponsor of this project is [Inversion](https: inversion.dev/cardano/). Here is a word from them! > At Inversion, we pride ourselves on our passion for life and our ability to create exceptional software solutions for our clients. Our team of experts, with over a century of cumulative experience, is dedicated to harnessing the power of the Cardano blockchain to bring innovative and scalable decentralized applications to life. We've successfully built applications for NFT management, staking and delegation, chain data monitoring, analytics, and web3 integrations, as well as countless non-blockchain systems. With a focus on security, transparency, and sustainability, our team is excited to contribute to the Cardano ecosystem, pushing the boundaries of decentralized technologies to improve lives worldwide. Trust Inversion to be your go-to partner for robust, effective, and forward-thinking solutions, whether blockchain based, traditional systems, or a mix of the two. They have recently started a podcast, called \"Africa On Chain\", which you can check out here: https: www.youtube.com/@africaonchain"
